# 创建参数
def parse_opt():
    parser = argparse.ArgumentParser()
    parser.add_argument('--mq_temp', type=str, default=r"my_temp", help='temporarily store recieved imgs')
    parser.add_argument('--save_path', type=str, default=r"my_save", help='detected pictures save path')
    mq_opt, unknown = parser.parse_known_args()
    if unknown:
        logging.debug('Unknown in my_detect.py arguments:', unknown)
    return mq_opt


# 主函数，循环监听
